import React, { FC } from 'react'
import styles from './QuestionCard.module.scss'

type propsType = {
  _id: string
  title: string
  isPublished: boolean
  isStart: boolean
  answerCount: number
  createdAt: string
}

const QuestionCard: FC<propsType> = (props: propsType) => {
  const { _id } = props
  return (
    <>
      <p>Question {_id}</p>
    </>
  )
}
export default QuestionCard
